import React from 'react';

import MovementSelection from '../MovementSelection/MovementSelection'

const App = () => {
  return (
    <div className="App">
      SFIT
      <MovementSelection value="Squat"/>
      <MovementSelection value="Deadlift"/>
      <MovementSelection value="Bench"/>
    </div>
  );
}

export default App;
